CREATE TABLE "chatApp_room_online" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "room_id" bigint NOT NULL REFERENCES "chatApp_room" ("id") DEFERRABLE INITIALLY DEFERRED, "chatuser_id" bigint NOT NULL REFERENCES "chatApp_chatuser" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "chatApp_message" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content" varchar(512) NOT NULL, "timestamp" datetime NOT NULL, "user_id" bigint NOT NULL REFERENCES "chatApp_chatuser" ("id") DEFERRABLE INITIALLY DEFERRED, "room_id" bigint NOT NULL REFERENCES "chatApp_room" ("id") DEFERRABLE INITIALLY DEFERRED);
